import "./Layout.css";
import Header from "../Header/Header";
import FooterNav from "../FooterNav/FooterNav";

export default function Layout(props) {
  return (
    <ReactComponent className="layout-container">
      <Header />
      <div className="layout-children">{props.children}</div>
      <FooterNav />
    </ReactComponent>
  );
}
